import "./address.css"
import { useAuth } from "../../hooks";
export const UserProfilePage = () => {
    const {authState:{user}}=useAuth()
  return (
    <div>
      <form className="padding-lg save-address flex-col width-fitContent address-fields">
        <div>
          <h1 className="bd-btm">Personal Info </h1>
          <hr />
        </div>
        <i className="fa-solid fa-user user-profile"></i>
        {!user ?"":<div className="flex-row">
          <div>
            <label>first Name</label>
            <h4>{user.firstName}</h4>
            <div>
              <label>Email</label>
              <h4>{user.Email}</h4>
            </div>
          </div>
          <div>
            <label>Last Name</label>
            <h4>{user.lastName}</h4>
          </div>
        </div>}
      </form>
    </div>
  );
};
